      <ProfileInfo saveProfile={props.saveProfile} savePhoto={props.savePhoto} profile={props.profile} status={props.status} getUpdateStatus = {props.getUpdateStatus} isOwner={props.isOwner}/>
      <MyPostsContainer />
    </div>
  )
}
export default Profile;
